'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class GetPriceHistoryCommand extends SendSingleCommandWithoutResponse {
    priceHistoryRequest;
    requestNumber;
    priceTerminalData;
    constructor() {
        super();
        this.commandName = "GetPriceHistoryCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createGetPriceHistoryRequestMessage(this.priceTerminalData, this.priceHistoryRequest, this.requestNumber, stdlib.nowutc());
    }
}
module.exports = GetPriceHistoryCommand
